Crear menú de Youtube-dl en Bash

#!/bin/bash

# Menu Item
URL=$1
function main_menu
{

while :
do
	clear
	echo " "
	echo "-------------------------------------"
	echo "            Menú principal           "
	echo "-------------------------------------"
	echo "[1] Descargar MP3"
	echo "[2] Descargar video (mejor versión)"
	echo "[3] Descargar video (max 480p)"
	echo "[4] Mostrar formatos"
	echo "[5] Exit"
	echo "====================================="
	echo "Selecciona una opción [1-5]: "
	read m_menu
	clear
	case "$m_menu" in

		1) option_1;;
		2) option_2;;
		3) option_3;;
		4) option_4;;
		5) exit 0;;
		"") option_1;;

		*)  ;;
	esac
done
}

function option_1
{
    youtube-dl --no-mtime -o '%(title)s.%(ext)s' --extract-audio --audio-format mp3 --audio-quality 0 --add-metadata $URL
	break
}

function option_2
{
	youtube-dl --no-mtime -f 'bestvideo[ext=mp4]+bestaudio[ext=m4a]/best[ext=mp4]/best' --add-metadata $URL
	break
}

function option_3
{
    youtube-dl --no-mtime -o '%(title)s.%(ext)s' -f "best[height<=720]" --add-metadata $URL
	break
}

function option_4
{
    youtube-dl -F $URL | sed -n '/format code/,$p'| sed -n '/webm/!p' | awk '{print $1,"\011",$2,"\011",$3}'
    echo Introduce el formato. Puede ser XXX+YYY:
    read varname
    youtube-dl --no-mtime -f $varname --add-metadata $URL
    break
}

main_menu
